using System;

namespace Sphene.SpheneServer.Data;

/// <summary>
/// Contains Base64 encoded PNG images for city banners used in public syncshells.
/// These high-quality 1400x400 pixel banners are generated from the SpheneClient banner creation scripts.
/// </summary>
public static class CityBannerImages
{
    /// <summary>
    /// Base64 encoded PNG image for Limsa Lominsa city banner (1400x400 pixels)
    /// </summary>
    public const string LimsaLominsaBase64 = "";

    /// <summary>
    /// Base64 encoded PNG image for Gridania city banner (1400x400 pixels)
    /// </summary>
    public const string GridaniaBase64 = "";

    /// <summary>
    /// Base64 encoded PNG image for Ul'dah city banner (1400x400 pixels)
    /// </summary>
    public const string UldahBase64 = "";

    /// <summary>
    /// Gets the Base64 encoded image data for the specified city.
    /// </summary>
    /// <param name="cityName">The name of the city (Limsa Lominsa, New Gridania, or Ul'dah)</param>
    /// <returns>Base64 encoded PNG image data, or null if city not found</returns>
    public static string? GetCityImageBase64(string cityName)
    {
        return cityName switch
        {
            "Limsa Lominsa" => LimsaLominsaBase64,
            "New Gridania" => GridaniaBase64,
            "Ul'dah" => UldahBase64,
            _ => null
        };
    }

    /// <summary>
    /// Gets the decoded byte array for the specified city image.
    /// </summary>
    /// <param name="cityName">The name of the city (Limsa Lominsa, New Gridania, or Ul'dah)</param>
    /// <returns>Decoded PNG image bytes, or null if city not found or image data is empty</returns>
    public static byte[]? GetCityImageBytes(string cityName)
    {
        var base64Image = GetCityImageBase64(cityName);
        return !string.IsNullOrEmpty(base64Image) ? Convert.FromBase64String(base64Image) : null;
    }
}